import React from "react";

const Movies = () => {
  return (
    <div>
      <h2>Lates Movies</h2>
      <div class="movies-container">
        <Movies
          title="Judul film 1"
          year={2012}
          genre="Comedy"
          poster="https://picsum.photos/200/300"
        />
        <Movies
          title="Judul film "
          year={2012}
          genre="Horror"
          poster="https://picsum.photos/200/300"
        />
        <Movies
          title="Judul film 3"
          year={2012}
          genre="Romance"
          poster="https://picsum.photos/200/300"
        />
      </div>
    </div>
  );
};

export default Movies;
